/*
DROP TABLE clientes;
DROP TABLE vendas;
DROP TABLE produtos;
*/

CREATE TABLE clientes (NR_CLIENTE INTEGER PRIMARY KEY, NOME VARCHAR(30) NOT NULL);
CREATE TABLE vendas (DATA DATE NOT NULL, NR_CLIENTE INTEGER NOT NULL, NR_PRODUTO INTEGER NOT NULL, QUANTIDADE INTEGER);
CREATE TABLE produtos (NR_PRODUTO INTEGER NOT NULL, NOME_PRODUTO VARCHAR(40), MARCA VARCHAR(30), VALOR NUMERIC(7,2)); 

